// TODO All of the above JS is necessary for the stupid hamburger nav dropdown
// when mobile. Migrate to a simpler nav.


Faktory = {};

var livePollTimer = null;

var ready = (callback) => {
  if (document.readyState != "loading") callback();
  else document.addEventListener("DOMContentLoaded", callback);
}

ready(() => {
  document.querySelectorAll(".check_all").forEach(node => {
    node.addEventListener("click", event => {
      node.closest('table').querySelectorAll('input[type=checkbox]').forEach(inp => { inp.checked = !!node.checked; });
    })
  });
});

function saveLocale(txt) {
  document.cookie = "faktory_locale="+txt;
  location.reload();
}

function handleConfirmDialog (event) {
  const target = event.target

  if (target.localName !== "input" && target.localName !== "button" ) { return }
  const confirmMessage = target.dataset.confirm

  if (confirmMessage === undefined) { return }

  if (!window.confirm(confirmMessage)) {
    event.preventDefault()
    event.stopPropagation()
  }
}

document.addEventListener("click", handleConfirmDialog)